import PropTypes from "prop-types";
import styled from "./button.module.css"

function Button({text = "버튼"}) {
  return (
    <button
      className={sty}
    >
      {text}
    </button>
  );
}

Button.propTypes = {
  text: PropTypes.string.isRequired,
};

export default Button;
